  false,\n\t\"url\": null,\n\t\"notes\": \"The nearshore sensors are part of the Pacific
  Islands Ocean Observing System (PacIOOS) and are designed to measure a variety of
  ocean parameters at fixed point locations. NS08 is located at the Palau International
  Coral Reef Center (PICRC) dock in Koror, Palau and is mounted to the bottom in about
  3.5 meters of water. The instrument is a Sea-Bird Electronics model 16+ V2 coupled
  with a WET Labs ECO-FLNTUS combination sensor.\",\n\t\"license_title\": null,\n\t\"extras\":
